import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import ToDo from './ToDo';
import * as serviceWorker from './serviceWorker';

const initialTasks = [
    {name: 'Finish Redux Tutorials', id: 1},
    {name: 'Learn more about Relay', id: 2},
    {name: 'Build 5 more React apps'},
    {name: 'Review React Component Lifecycle'},
    {name: 'Obtain Data Visualization Certificate'},
    {name: 'Review Algorithms'},
]

ReactDOM.render(<ToDo tasks = {initialTasks}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
